import React from "react";
import { StyleSheet, Text, View } from "react-native";
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
    width: "100%",
    height: "100%",
    //margin left and right
    marginLeft: "30px",
    marginRight: "30px",
    //margin top and bottom
    marginTop: "30px",
    marginBottom: "30px",
  },
  input: {
    height: "40px",
    margin: 12,
    borderWidth: 1,
    width: "100%",
    height: "100%",
    backgroundColor: "grey",
  },
  input_container: { 
    width: "100%",
    height: "100%",
  }
});
export default styles;
